/* ------------------------------------------------------------------------------------------------------------------------- */
function isEven(number) { return number % 2 === 0;}
/* ------------------------------------------------------------------------------------------------------------------------- */
function MyRandomNumber() {return Math.floor(Math.random() * 1000);};
/* ------------------------------------------------------------------------------------------------------------------------- */
function getRandomNumber(min, max) {return Math.floor(Math.random() * (max - min + 1)) + min;}
/* ------------------------------------------------------------------------------------------------------------------------- */
function arrOval(startX, startY, radiusX, radiusY, vector, speed){
  let arrPoints = [];
  if(vector == 1){
    /*let center = {x: startX + radiusX, y: startY - radiusY};*/
    let center = {x: startX + radiusX, y: startY};
    for (let a = 0; a <= Math.PI; a += speed * 0.01) {
      let x = center.x - Math.cos(a) * radiusX;
      let y = center.y - Math.sin(a) * radiusY;
      arrPoints.push({X: x, Y: y});
    }
  } else if(vector == 0){
    /*let center = {x: startX - radiusX, y: startY - radiusY};*/
    let center = {x: startX - radiusX, y: startY};
    for (let a = 0; a <= Math.PI; a += speed * 0.01) {
      let x = center.x + Math.cos(a) * radiusX;
      let y = center.y - Math.sin(a) * radiusY;
      arrPoints.push({X: x, Y: y});
    }
  }
  return arrPoints;
}
/* ------------------------------------------------------------------------------------------------------------------------- */
const delay = (interval)=>{return new Promise(function(resolve){setTimeout(resolve, interval);});}; 
/* ------------------------------------------------------------------------------------------------------------------------- */
/* Work of ChatGPT */
function AddIdChangeIdHref(mytext,zamina) {
  const regexId = /id="([^"]*)"/g;
  const regexHref = /href="([^"]*)"/g;
  const regexSvg = /<svg([^>]*)>/g;
  let result = mytext;
  result = result.replace(regexId, (match, p1) => `id="${p1}${zamina}"`);
  result = result.replace(regexHref, (match, p1) => `href="${p1}${zamina}"`);
  result = result.replace(regexSvg, (match, p1) => `<svg${p1} id="${zamina}">`);
  return result;
}
