function StartAnimationTravel(address){
  if(FlagStart){
    fetch(`${address}/goals.json`)
    .then(response => response.json())
    .then(data => {
      arrWagons  = JSON.parse(JSON.stringify(data));
      parentElement = null;
      pw = 0;
      ph = 0;
      pmax = 0;
      pmin = 0;
      kurort = null;
      scene = null;
      person = null;
      thing = null;
      tasksblocks = null;
      wagons = null;
      animationIdWagonAnimate = null;
      randomLeft = 0;
      randomTop = 0;
      numtask = 0;
      time_new_task = 0;

      personBottom = '0';
      personWidth = 0;
      personHeight = 0;
  
      InitObjects();
    })
    .catch(error => console.error(error));
  }  
}
/* ------------------------------------------------------------------------------------------------------------------------- */
function InitObjects(){
  if(FlagStart){
    parentElement = document.querySelector('.parentblock');
    parentElement.style.padding = 0;
    parentElement.style.boxSizing = `border-box`;
    parentElement.style.overflow = 'hidden';
    parentElement.style.backgroundColor = 'black';

    pw = parentElement.offsetWidth;
    ph = parentElement.offsetHeight;
    pmax = (pw>=ph)?pw:ph;
    pmin = (pw<=ph)?pw:ph;
  
    SceneMake();
    PersonPaint(Standing_man_svg, `standingman`,`visible`);
    TasksBlocksPaint();
    TaskMove();
    ThingPaint(Papka_svg, `thing_papka`,`hidden`);
  }
}
