/* ------------------------------------------- Створення і промальовка стоячої персони ------------------------------------- */
function PersonPaint(var_name, id_name, showing){
  if(FlagStart){
    person = document.createElement('div');
    person.id = `person_animationtravel`;
    scene.appendChild(person);
    person = document.getElementById('person_animationtravel');

    personBottom = '0';
    personWidth = 30;
    personHeight = 30;

    person.style.position = 'absolute';
    person.style.bottom = `${personBottom}px`;
    person.style.width = personWidth*(ph * 0.01)+'px';
    person.style.height = personHeight*(ph * 0.01)+'px';
    person.style.left = (scene.offsetWidth / 2) - (person.offsetWidth / 2) + 'px';
    /*person.style.border = `1px solid red`;*/
    person.style.visibility = showing;

    person.innerHTML = AddIdChangeIdHref(var_name, id_name);

    let standingman = document.getElementById(id_name);
    standingman.setAttribute(`width`,`${384}`);      
    standingman.setAttribute(`height`,`${384}`);
    standingman.setAttribute("viewBox", `${-72} ${-16} ${384} ${384}`);
    standingman.style.width = `100%`;
    standingman.style.height = `100%`;
  }  
}
