/* ------------------------------------------- Зміна персони --------------------------------------------------------------- */
function PersonChange(var_name, id_name, count_repeat){
  if(FlagStart){
    person.innerHTML = AddIdChangeIdHref(var_name, id_name);
    let throw_papka = document.getElementById(id_name);

    if(id_name == 'happy_svg'){
      throw_papka.setAttribute("viewBox", `${128-(1.28*20)} ${128-(1.28*60)} ${384+(3.84*20)} ${384+(3.84*30)}`);
    } else {
      throw_papka.setAttribute("viewBox", `${128} ${128} ${384} ${384}`);
    }

    throw_papka.setAttribute(`width`,`${384}`);    
    throw_papka.setAttribute(`height`,`${384}`);

    throw_papka.style.width = `100%`;      
    throw_papka.style.height = `100%`;



    let animations = throw_papka.querySelectorAll("animateMotion");

    if(animations.length >0){
      animations.forEach((animation)=>{animation.setAttribute("repeatCount", `${count_repeat}`);});

      animations = person.querySelectorAll("animateTransform");
      animations.forEach((animation)=>{animation.setAttribute("repeatCount", `${count_repeat}`);});

      animations = person.querySelectorAll("animate");
      animations.forEach((animation)=>{animation.setAttribute("repeatCount", `${count_repeat}`);});
    }
  }
};
