/* ------------------------------------------- Створення і промальовка предмета -------------------------------------------- */
function ThingPaint(var_name, id_name, showing){
  if(FlagStart){
    thing = document.createElement('div');
    thing.id = `thing_animationtravel`;
    scene.appendChild(thing);
    thing = document.getElementById('thing_animationtravel');

    let thingWidth = 5;
    let thingHeight = 4;

    thing.style.position = 'absolute';
    thing.style.display = `flex`;
    thing.style.visibility = showing;

    let thingLeft = person.offsetLeft + person.offsetWidth / 4;
    thing.style.left = thingLeft + 'px';

    thing.style.width = thingWidth * (pmin * 0.025) + 'px';
    thing.style.height = thingHeight * (pmin * 0.025) + 'px';

    let thingTop = person.offsetTop - thing.offsetHeight;
    thing.style.top = thingTop + 'px';

    thing.style.transition = "left 1.0s ease-out, top 1.0s ease-out, transform 1.0s ease-in-out";

    thing.innerHTML = AddIdChangeIdHref(var_name, id_name);
    let thing_papka = document.getElementById(id_name);
    thing_papka.style.width = `100%`;
    thing_papka.style.height = `100%`;
    thing_papka.setAttribute("viewBox", `${96} ${96} ${64} ${64}`);

    thing.style.transform = `scale(${0.5})`;
  }  
}
/* ------------------------------------------- Зміна предмета -------------------------------------------- */
function ThingChange(var_name, id_name, showing){
  if(FlagStart){
    thing.innerHTML = AddIdChangeIdHref(var_name, id_name);
    let thing_name = document.getElementById(id_name);
    thing_name.style.width = `100%`;
    thing_name.style.height = `100%`;
    thing.dataset.idname = id_name;
    if(id_name == 'thing_paper'){
      thing_name.setAttribute("viewBox", `${0} ${0} ${256} ${256}`);
      thing.style.transform = `scale(${10})`;
    } else {
      thing_name.setAttribute("viewBox", `${96} ${96} ${64} ${64}`);
      thing.style.transform = `scale(${0.5})`;
    }
  }
}
