/* ------------------------------------------- Створення блоків завдань ---------------------------------------------------- */
function TasksBlocksPaint(){
  if(FlagStart){
    arrWagons.forEach((tb, index)=>{
      tb = document.createElement('div');
      tb.classList.add('tasksblocks_animationtravel');
      scene.appendChild(tb);
      tb.style.position = 'absolute';
      tb.style.display = `flex`;
      tb.style.justifyContent = 'center';
      tb.style.alignItems =  'center';
      tb.style.padding = 5*(pmin * 0.01)+'px';
      tb.style.left = '100%';
      tb.style.top = '0';
      tb.style.minWidth = 10*(pmin * 0.01)+'px';
      tb.style.minHeight = 5*(pmin * 0.01)+'px';

      tb.style.maxWidth = `95%`;
      tb.style.maxHeight = `95%`;

      tb.style.fontSize = `${0.07*pmin}px`;

      tb.style.backgroundColor = '#334145';


      const colors = ["#A0ABBA", "#668290", "#405060", "#334145"];
      tb.style.background = `radial-gradient(circle, ${colors.join(",")})`;


      tb.style.color = 'yellow';

      tb.style.transition = "opacity 0.25s ease-out,  left 1.0s ease-in-out, transform 1.0s ease-in-out";
      tb.style.transform = `scale(${0.25})`;
      tb.style.borderRadius = '10px';
      tb.innerHTML = arrWagons[index].content;
      tb.dataset.thing = arrWagons[index].thing;
      tb.style.whiteSpace = `nowrap`;

    });  
    tasksblocks = document.querySelectorAll(`.tasksblocks_animationtravel`);
  }  
} 
