/* ------------------------------------------- Переміщення блока завдання -------------------------------------------------- */
function TaskMove(){
  if(FlagStart && numtask < tasksblocks.length){
      tasksblocks[numtask].style.opacity = '1';
      tasksblocks[numtask].style.left = `${ (scene.offsetWidth / 2) - (tasksblocks[numtask].offsetWidth / 2) }px`;
      tasksblocks[numtask].style.top = `${(scene.offsetHeight - person.offsetHeight) / 6 }px`;
      /* tasksblocks[0].style.backgroundColor = 'cyan';*/
      /*tasksblocks[numtask].style.backgroundColor = '#6c6c7a';*/
      /*tasksblocks[numtask].style.backgroundColor = '#db701e';*/
      /*tasksblocks[numtask].style.backgroundColor = '#211311';*/
      tasksblocks[numtask].style.backgroundColor = '#334145';
      tasksblocks[numtask].style.transform = `scale(${1})`;
      delay(500).then(()=>{
        if(tasksblocks[numtask].dataset.thing == 0) {
          PersonChange(Throw_papka_svg, `throw_papka`, 1); 
          ThingChange(Papka_svg, `thing_papka`,`visible`);
        }     
        if(tasksblocks[numtask].dataset.thing == 1) {
          PersonChange(Throw_paper_svg, `throw_paper`, 1);
          ThingChange(Paper_svg, `thing_paper`, `visible`);
        }      
        if(tasksblocks[numtask].dataset.thing == 2) {
          PersonChange(Throw_bootle_svg, `throw_bootle`,1);
          ThingChange(Bootle_svg,`thing_bootle`, `visible`);
        }    
        delay(1100).then(()=>{
          TaskUdar();
        });
      });
  } else {
    numtask = 0;
    //TaskMove();    
    //StartAnimationTravel(`http://127.0.0.1:5500`);
    StartAnimationTravel(`https://voyagerua.github.io/frg/`);

  }
};
/* ------------------------------------------------------------------------------------------------------------------------- */
/* ------------------------------------------- Зіткнення предмета з блоком завдання ---------------------------------------- */
function TaskUdar(){
  if(FlagStart){
    thing.style.visibility = `visible`;
    if(thing.dataset.idname == 'thing_paper'){
      thing.style.transform = `scale(${15})`;
    } else {
      thing.style.transform = `scale(${4})`;
    }
    thing.style.left = tasksblocks[numtask].offsetLeft + tasksblocks[numtask].offsetWidth / 4  + 'px';
    thing.style.top = tasksblocks[numtask].offsetTop + 'px';
   
    delay(1000).then(()=>{
      thing.style.left = person.offsetLeft + person.offsetWidth / 4 +'px';    
      thing.style.top = person.offsetTop - thing.offsetHeight +'px';    
      thing.style.visibility = 'hidden';
      thing.style.transform = `scale(${0.5})`;

      tasksblocks[numtask].style.color = 'transparent';
      tasksblocks[numtask].style.color = 'black';
      tasksblocks[numtask].style.color = 'maroon';
      tasksblocks[numtask].style.color = 'white';
      tasksblocks[numtask].style.color = 'blue';
      tasksblocks[numtask].style.color = 'teal';

      /*tasksblocks[numtask].style.backgroundImage = `url('./img/svg/Hrest.svg')`;*/
      tasksblocks[numtask].style.backgroundImage = `url('./Hrest.svg')`;
      tasksblocks[numtask].style.backgroundSize = `contain`;
      tasksblocks[numtask].style.backgroundRepeat = `no-repeat`;
      tasksblocks[numtask].style.backgroundPosition = `center`;   

      delay(1000).then(()=>{
        TaskRemove();
        numtask++;
      });

    });
  }  
}  
/* ------------------------------------------------------------------------------------------------------------------------- */
/* ------------------------------------------- Зникнення блоку завдання з екрану ------------------------------------------- */
function TaskRemove(){
  if(FlagStart && numtask < tasksblocks.length){

    tasksblocks[numtask].style.opacity = '0';
    tasksblocks[numtask].style.left = `100%`;
    tasksblocks[numtask].style.transform = `scale(${0.25})`;


    if(tasksblocks[numtask].dataset.thing == 2){
      if(document.getElementById("id_vybuh")){
        document.getElementById("id_vybuh").remove();
      }
      let vybuh = document.createElement('div');
      vybuh.id ='id_vybuh';
      vybuh.style.width = '200%';
      vybuh.style.height = '200%';
      vybuh.style.transform = `translate(-${25}%, ${-15}%)`;

      vybuh.style.zIndex = 20;

      /*vybuh.style.backgroundImage = `url('./img/anime/Vybuh.gif')`;*/
      vybuh.style.backgroundImage = `url('./Vybuh.gif?${MyRandomNumber()}')`;

      //console.log(`tasksblocks[numtask].dataset.thing=${tasksblocks[numtask].dataset.thing}`);
      //console.log(`vybuh.style.backgroundImage=${vybuh.style.backgroundImage}?${MyRandomNumber()}`);

      vybuh.style.backgroundSize = `cover`;
      vybuh.style.backgroundRepeat = `no-repeat`;
      vybuh.style.backgroundPosition = `center`;   
      scene.appendChild(vybuh);

      delay(1000).then(()=>{
        scene.style.background = `transparent`;
        kurort.style.filter = `blur(0px)`;
        delay(1000).then(()=>{
          PersonChange(Happy_svg, 'happy_svg', 5);
          delay(7000).then(()=>{

            scene.style.background = `
            linear-gradient(to bottom, 
            rgba(150, 200, 230, 0.7) 0%, 
            rgba(180, 220, 255, 0.9) 50%, 
            rgba(240, 250, 250, 0.9) 100%)`;

            kurort.style.filter = `blur(15px)`;
            TaskMove();
          });

        });
      });
     

    } else {
      delay(1000).then(()=>{
        TaskMove();
      });
    }

  }  
}
